-- ----------------------------
-- Function structure for minEquipo
-- ----------------------------
DROP FUNCTION IF EXISTS `minEquipo`;
delimiter ;;
CREATE FUNCTION `minEquipo`(`p_equipo_id` INT)
 RETURNS tinyint
  READS SQL DATA 
BEGIN
  DECLARE c INT DEFAULT 0;
  SELECT COUNT(*) INTO c FROM jugador WHERE id_equipo = p_equipo_id;
  RETURN (c >= 13);
END
;;
delimiter ;

-- ----------------------------
-- Function structure for tecnicoOblig
-- ----------------------------
DROP FUNCTION IF EXISTS `tecnicoOblig`;
delimiter ;;
CREATE FUNCTION `tecnicoOblig`(`p_equipo_id` INT)
 RETURNS tinyint
  READS SQL DATA 
BEGIN
  DECLARE t INT;
  SELECT id_tecnico INTO t FROM equipo WHERE id = p_equipo_id;
  RETURN IF(t IS NULL OR t = 0, 0, 1);
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table equipo
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_tecnico_update`;
delimiter ;;
CREATE TRIGGER `validar_tecnico_update` BEFORE UPDATE ON `equipo` FOR EACH ROW BEGIN
    DECLARE coincidencias INT;

    -- Solo verificamos si realmente cambiaron al tcnico
    IF NEW.id_tecnico != OLD.id_tecnico THEN
        
        -- Buscamos si el NUEVO tcnico ya est en algn torneo
        -- donde este equipo (NEW.id) est participando.
        SELECT COUNT(*) INTO coincidencias
        FROM torneo_equipo te_mi_equipo
        -- Unimos para ver los otros equipos del mismo torneo
        JOIN torneo_equipo te_otros ON te_mi_equipo.torneo_id = te_otros.torneo_id
        -- Unimos para ver quin es el tcnico de esos otros equipos
        JOIN equipo e_otros ON te_otros.equipo_id = e_otros.id
        WHERE te_mi_equipo.equipo_id = NEW.id    -- Buscamos torneos de MI equipo
          AND e_otros.id_tecnico = NEW.id_tecnico -- El nuevo tcnico dirige a alguien ah?
          AND e_otros.id != NEW.id;               -- Que no sea yo mismo (obvio)

        -- Si encontramos coincidencias, lanzamos el error
        IF coincidencias > 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Error: Este tcnico ya dirige otro equipo en el mismo torneo.';
        END IF;

    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table jornada
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_equipos_antes_fixture`;
delimiter ;;
CREATE TRIGGER `validar_equipos_antes_fixture` BEFORE INSERT ON `jornada` FOR EACH ROW BEGIN
    DECLARE total_equipos INT;
    DECLARE equipos_incompletos INT;

    -- 1. VALIDAR CANTIDAD: Hay 12 equipos inscritos?
    SELECT COUNT(*) INTO total_equipos
    FROM torneo_equipo
    WHERE torneo_id = NEW.torneo_id;

    IF total_equipos != 12 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: El torneo no tiene los 12 equipos necesarios para generar el calendario.';
    END IF;

    -- 2. VALIDAR CALIDAD: Estn todos "Activos" (11 jugadores min)?
    -- Buscamos equipos en este torneo que tengan estado = 0
    SELECT COUNT(*) INTO equipos_incompletos
    FROM equipo e
    INNER JOIN torneo_equipo te ON e.id = te.equipo_id
    WHERE te.torneo_id = NEW.torneo_id
      AND e.estado = 0; -- 0 significa Incompleto/Inactivo segn tu lgica anterior

    IF equipos_incompletos > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: Hay equipos inscritos que no completan la plantilla mnima (11 jugadores).';
    END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table jornada
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_orden_simulacion`;
delimiter ;;
CREATE TRIGGER `validar_orden_simulacion` BEFORE UPDATE ON `jornada` FOR EACH ROW BEGIN
    DECLARE estado_anterior TINYINT;

    -- Solo validamos si estamos intentando marcarla como SIMULADA (1)
    -- y si NO es la Jornada 1 (la 1 no tiene anterior)
    IF NEW.simulada = 1 AND OLD.simulada = 0 AND NEW.num > 1 THEN
        
        -- Buscamos el estado de la jornada anterior (num - 1) del MISMO torneo
        SELECT simulada INTO estado_anterior
        FROM jornada
        WHERE torneo_id = NEW.torneo_id 
          AND num = (NEW.num - 1);

        -- Si la anterior no est simulada (0), lanzamos el error
        IF estado_anterior = 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Error: Debes simular las jornadas en orden. Falta la jornada anterior.';
        END IF;

    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table jugador
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_minimo_jugadores_insert`;
delimiter ;;
CREATE TRIGGER `validar_minimo_jugadores_insert` AFTER INSERT ON `jugador` FOR EACH ROW BEGIN
    DECLARE cantidad INT;

    -- 1. Contamos cuntos jugadores tiene AHORA el equipo del nuevo jugador
    SELECT COUNT(*) INTO cantidad 
    FROM jugador 
    WHERE id_equipo = NEW.id_equipo;

    -- 2. Si llega a 11 (o ms), lo activamos (estado = 1)
    IF cantidad >= 11 THEN
        UPDATE equipo 
        SET estado = 1 
        WHERE id = NEW.id_equipo;
    END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table jugador
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_minimo_jugadores_delete`;
delimiter ;;
CREATE TRIGGER `validar_minimo_jugadores_delete` AFTER DELETE ON `jugador` FOR EACH ROW BEGIN
    DECLARE cantidad INT;

    -- 1. Contamos cuntos quedaron despus de borrar
    SELECT COUNT(*) INTO cantidad 
    FROM jugador 
    WHERE id_equipo = OLD.id_equipo;

    -- 2. Si baj de 11, lo desactivamos (estado = 0)
    IF cantidad < 11 THEN
        UPDATE equipo 
        SET estado = 0 
        WHERE id = OLD.id_equipo;
    END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_torneo_antes_insertar`;
delimiter ;;
CREATE TRIGGER `validar_torneo_antes_insertar` BEFORE INSERT ON `torneo` FOR EACH ROW BEGIN
    DECLARE traslape INT;

    -- A. VALIDACIN: Fecha Inicio vs Fin
    IF NEW.fechainicio >= NEW.fechafin THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: La fecha de inicio debe ser anterior a la fecha de finalizacin.';
    END IF;

    -- B. VALIDACIN: Traslape de fechas
    -- Verificamos si existe algn torneo cuyas fechas choquen con las nuevas
    SELECT COUNT(*) INTO traslape
    FROM torneo
    WHERE (NEW.fechainicio BETWEEN fechainicio AND fechafin)
       OR (NEW.fechafin BETWEEN fechainicio AND fechafin)
       OR (fechainicio BETWEEN NEW.fechainicio AND NEW.fechafin);

    IF traslape > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: Las fechas coinciden con un torneo ya existente. No se permiten torneos simultneos.';
    END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo
-- ----------------------------
DROP TRIGGER IF EXISTS `validar_torneo_antes_actualizar`;
delimiter ;;
CREATE TRIGGER `validar_torneo_antes_actualizar` BEFORE UPDATE ON `torneo` FOR EACH ROW BEGIN
    DECLARE traslape INT;

    -- 1. VALIDACIN: Fecha Inicio vs Fin (Igual que en el Insert)
    IF NEW.fechainicio >= NEW.fechafin THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: La fecha de inicio debe ser anterior a la fecha de finalizacin.';
    END IF;

    -- 2. VALIDACIN: Traslape de fechas
    -- AQUI ESTA LA MAGIA: "AND id != OLD.id"
    -- Significa: "Busca choques con todos los torneos MENOS conmigo mismo"
    SELECT COUNT(*) INTO traslape
    FROM torneo
    WHERE id != OLD.id 
      AND (
           (NEW.fechainicio BETWEEN fechainicio AND fechafin)
        OR (NEW.fechafin BETWEEN fechainicio AND fechafin)
        OR (fechainicio BETWEEN NEW.fechainicio AND NEW.fechafin)
      );

    IF traslape > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: Las fechas actualizadas coinciden con otro torneo existente.';
    END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo_equipo
-- ----------------------------
DROP TRIGGER IF EXISTS `bloquear_exceso_equipos`;
delimiter ;;
CREATE TRIGGER `bloquear_exceso_equipos` BEFORE INSERT ON `torneo_equipo` FOR EACH ROW BEGIN
    DECLARE cantidad INT;
    
    -- Contamos cuntos hay en el torneo donde intentan insertar
    SELECT COUNT(*) INTO cantidad 
    FROM torneo_equipo 
    WHERE torneo_id = NEW.torneo_id;

    -- Si ya hay 12 o ms, lanzamos error
    IF cantidad >= 12 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: Este torneo ya tiene el cupo lleno (12 equipos).';
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo_equipo
-- ----------------------------
DROP TRIGGER IF EXISTS `verificar_tecnico_unico_por_torneo`;
delimiter ;;
CREATE TRIGGER `verificar_tecnico_unico_por_torneo` BEFORE INSERT ON `torneo_equipo` FOR EACH ROW BEGIN
    DECLARE v_id_tecnico_a_verificar INT;
    DECLARE v_tecnico_existente INT;

    -- Paso 1: Obtener el ID del tcnico del equipo que se est insertando (NEW.equipo_id)
    SELECT id_tecnico INTO v_id_tecnico_a_verificar
    FROM equipo
    WHERE id = NEW.equipo_id;

    -- Paso 2: Contar cuntos equipos (adems del actual) ya usan a ese tcnico
    SELECT COUNT(te.equipo_id) INTO v_tecnico_existente
    FROM torneo_equipo te
    JOIN equipo e ON te.equipo_id = e.id
    WHERE te.torneo_id = NEW.torneo_id         -- Debe ser en el mismo torneo
      AND e.id_tecnico = v_id_tecnico_a_verificar;  -- Debe ser el mismo tcnico

    -- NOTA: Como es un BEFORE INSERT, el registro NEW.equipo_id no est en te, por lo tanto el contador ser correcto.

    -- Paso 3: Si el contador es mayor que cero, significa que ya hay otro equipo con ese tcnico en el torneo.
    IF v_tecnico_existente > 0 THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'El tcnico ya est asignado a otro equipo en este torneo.';
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo_equipo
-- ----------------------------
DROP TRIGGER IF EXISTS `activar_torneo_al_llenar`;
delimiter ;;
CREATE TRIGGER `activar_torneo_al_llenar` AFTER INSERT ON `torneo_equipo` FOR EACH ROW BEGIN
    DECLARE cantidad INT;
    
    -- Contamos de nuevo (incluyendo el que acabamos de meter)
    SELECT COUNT(*) INTO cantidad 
    FROM torneo_equipo 
    WHERE torneo_id = NEW.torneo_id;

    -- Si llegamos a 12 exactos, ACTIVAMOS el torneo
    IF cantidad = 12 THEN
        UPDATE torneo 
        SET estado = 1 
        WHERE id = NEW.torneo_id;
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table torneo_equipo
-- ----------------------------
DROP TRIGGER IF EXISTS `desactivar_torneo_al_borrar`;
delimiter ;;
CREATE TRIGGER `desactivar_torneo_al_borrar` AFTER DELETE ON `torneo_equipo` FOR EACH ROW BEGIN
    DECLARE cantidad INT;
    
    -- Contamos cuntos quedan (usamos OLD porque el registro ya se fue)
    SELECT COUNT(*) INTO cantidad 
    FROM torneo_equipo 
    WHERE torneo_id = OLD.torneo_id;

    -- Si bajamos de 12, DESACTIVAMOS el torneo
    IF cantidad < 12 THEN
        UPDATE torneo 
        SET estado = 0 
        WHERE id = OLD.torneo_id;
    END IF;
END
;;
delimiter ;

